style.css:
@-moz-document url("https://neal.fun/infinite-craft/") {
.container{
        background: #303338 !important;
            border-color:#040404 !important;
    }
    .sidebar{
        border-color:#000 !important;
        border-width: 5px !important
    }
    .items{
        background: #191919 !important;
        border-color:#040404 !important;
        border-width: 2px !important
    }
    .sidebar-input{
        background: #000 !important;
        border-color:#000 !important;
        color: #ffc3d7 !important;
        border-width: 0px !important;
    }
    .item {
        background: #ff99c7 !important;
        border-color:#000 !important;
        border-width: 2px !important
    }
    .item:hover {
        background-color: #c55a83 !important;
        border-color:#000 !important;
    }
    div[id^="instance-"]{
        background: #ff99c7 !important;
    }
    div[id^="instance-"]:hover{
        background: #c55a83 !important;
    }
    .coffee {
        visibility: hidden !important;
    }
}
